    const laptops = ["hp","asus","acer","dell"]
    var arr = laptops.map((item)=>{
        return(
            <span>{item}</span>
        )
    })
    return(
         <div>
             <h3>Array list will be</h3>
             <h4></h4>
         </div>
    )

}
export default New;
